import React from 'react'
import photo from '../../assets/images/simple-doc-port.jpeg'

function PhotoList() {
    return (
        <div className="flex-row">
            <img
            src={photo}
            alt="Portfolio example"
            className="img-thumbnail mx-1"
            />
        </div>
    )
}

export default PhotoList;
